RECORDED_VALUES = collections.defaultdict(list)


def count_occurrences(hashes, num_buckets=None):
    # Turn an iterator into a list.
    if not isinstance(hashes, (list, tuple)):
        hashes = list(hashes)
    if not num_buckets:
        num_buckets = max(hashes) + 1
    buckets = [0] * num_buckets
    for h in hashes:
        buckets[h] += 1
    return buckets


class Occurrences(object):
    """Compute the counts of unique values given a set of numbers."""
    def __init__(self, samples=None, counts=None):
        if samples:
            assert not counts
            self.counts = count_occurrences(samples)
        elif counts:
            if isinstance(counts, list):
                self.counts = counts
            else:
                self.counts = list(counts)
        else:
            raise ValueError("Can't count occurrences of nothing!")
        self.have_stats = False
        self.compute_stats()

    def add(self, other):
        # Sometimes of the counts is missing some values (i.e. if the highest
        # count wasn't produced by one of them).
        oc = other.counts
        if len(oc) > len(self.counts):
            self.counts.extend([0] * (len(oc) - len(self.counts)))
        for i in range(len(oc)):
            self.counts[i] += other.counts[i]
        self.have_stats = False

    def compute_stats(self):
        if self.have_stats:
            return
        self.mean = statistics.mean(self.counts)
        self.median = statistics.median(self.counts)
        self.var = statistics.variance(self.counts) if len(self.counts) > 1 else 0
        self.spread = max(self.counts) - min(self.counts)
        self.spread_pct = 100 * self.spread / self.mean

        np_counts = np.array(self.counts)
        self.pdr = stats.chisquare(np_counts)

    def print_summary(self):
        self.compute_stats()
        print('med=%d avg=%s var=%s p2p=%d p2p%%=%s' % (
            self.median, self.mean, self.var, self.spread, self.spread_pct))

    def print_count_table(self, num_per_row=16):
        count_strs = ["%d" % v for v in self.counts]
        max_digits = max(map(len, count_strs))
        num_rows = int((len(self.counts) + num_per_row - 1) / num_per_row)
        for r in range(num_rows):
            start = r * num_per_row
            print("[%2d]" % start, end='')
            for c in range(num_per_row):
                i = start + c
                if i >= len(self.counts):
                    break
                count_str = count_strs[i]
                print(" " * (max_digits - len(count_str)), count_str, end='')
            print()

    def print_chisquare(self):
        # self.compute_stats()
        # counts = np.array(self.counts)
        # print(counts)
        print(self.pdr)
        # chi2_stat, p_val, dof, ex = stats.chi2_contingency(counts)
        # print("P-Value=%s" % p_val)




def EvalBitRange(bit_offset, num_bits, num_iterations_set=None):
    assert(bit_offset >= 0)
    assert(num_bits > 0)
    assert(bit_offset + num_bits <= 32)
    bit_range = (bit_offset, bit_offset+num_bits)
    mask = (1 << num_bits) - 1

    print('#' * 80)
    print('Evaluating bits [%d:%d] of the samples' % bit_range)

    for num_iterations in sorted(RECORDED_VALUES.keys()):
        if num_iterations_set and num_iterations not in num_iterations_set:
            continue
        lst = RECORDED_VALUES[num_iterations]
        print()
        print('JitterRandom num_iterations=%d, num_samples=%d' % (
            num_iterations, len(lst)))

        occurrences = Occurrences(
            samples=[((v >> bit_offset) & mask) for v in lst])
        occurrences.compute_stats()
        occurrences.print_summary()
        occurrences.print_chisquare()
        if num_bits <= 8:
            occurrences.print_count_table()


def EvalNumBits(num_bits, num_iterations_set=None):
    assert(num_bits > 0)
    mask = (1 << num_bits) - 1

    print('#' * 80)
    print('Evaluating all %d bit sequences in the samples' % num_bits)

    for num_iterations in sorted(RECORDED_VALUES.keys()):
        if num_iterations_set and num_iterations not in num_iterations_set:
            continue
        r32_samples = RECORDED_VALUES[num_iterations]
        num_bits_samples = []

        for bit_offset in range(33 - num_bits):
            tmp_lst = [0] * len(r32_samples)
            for i, v in enumerate(r32_samples):
                tmp_lst[i] = (v >> bit_offset) & mask
            num_bits_samples.extend(tmp_lst)

        print()
        print('JitterRandom num_iterations=%d, num_samples=%d' % (
            num_iterations, len(num_bits_samples)))

        occurrences = Occurrences(samples=num_bits_samples)
        occurrences.compute_stats()
        occurrences.print_summary()
        occurrences.print_chisquare()
        if num_bits <= 8:
            occurrences.print_count_table()


def RecordRandom32(num_iterations, values):
    lst = RECORDED_VALUES[num_iterations]
    lst.extend(values)


def main():
    # Determine the randomness of the top-byte of the samples.
    bit_offset = 8
    num_bits = 8
    EvalBitRange(bit_offset, num_bits, num_iterations_set=set(range(6,21)))
    EvalNumBits(num_bits, num_iterations_set=set(range(6,21)))


